ce please set icon background color from icon design toggle.'=>'Verwenden Sie animierte Welle für Ihr Symbol. Für eine bessere Erfahrung, bitte set Symbol hintergrund Farbe von icon-Designs Umschalten.','Animated Wave Color'=>'Animierte Welle Farbe','Here you can define custom color for the animated wave of your icon.'=>'Hier können Sie festlegen, benutzerdefinierte Farbe für die animierte Welle der Ihren icon.','Icon/Text Alignment'=>'Symbol/Text Alignment','Align content to the left, right or center.'=>'Align-Inhalt nach Links, rechts oder Mitte.','Spacing Between Icon and Text'=>'Abstand Zwischen Symbol und Text','Here you can define spacing between icon and text.'=>'Hier können Sie definieren den Abstand zwischen Symbol und text.','Here you can define static height for your image.'=>'Hier können Sie festlegen, statische Höhe für das Bild.','Color'=>'Farbe','Here you can define custom color for your icon.'=>'Hier können Sie festlegen, benutzerdefinierte Farbe für das Symbol.','Here you can define custom background for your icon.'=>'Hier können Sie festlegen, benutzerdefinierte hintergrund für Ihr Symbol.','Here you can define custom size for your icon.'=>'Hier können Sie festlegen, benutzerdefinierte Größe für Ihr Symbol.','Opacity'=>'Deckkraft','Define the opacity for the icon. Set the value from 0 - 1. The lower value, the more transparent.'=>'Definieren Sie die Deckkraft für das Symbol. Setzen Sie den Wert von 0 bis 1. Der niedrigere Wert, desto transparenter wird.','Height'=>'Höhe','Here you can define static height for your icon.'=>'Hier können Sie festlegen, statische Höhe für Ihr Symbol.','Width'=>'Breite','Here you can define static width for your icon.'=>'Hier können Sie festlegen, statische Breite für das Symbol.','Border Radius'=>'Border-Radius','Here you can define the radius value for your icon border.'=>'Hier können Sie definieren den radius-Wert für das Symbol Grenze.','Popup Background'=>'Popup-Hintergrund','Here you can define custom background color for your popup.'=>'Hier können Sie festlegen, benutzerdefinierte Hintergrundfarbe für das popup.','Close Icon Color'=>'Schließen-Symbol-Farbe','Here you can define custom color for your popup close icon.'=>'Hier können Sie festlegen, benutzerdefinierte Farbe für Ihre popup-schließen-Symbol.','Use Text Box'=>'Verwenden Sie Text Box','Text Box Height'=>'Text Im Feld Höhe','Here you can define static height for your text box.'=>'Hier können Sie festlegen, statische Höhe für Ihren text box.','Text Box Width'=>'Text-Box-Breite','Here you can define static width for your text box.'=>'Hier können Sie festlegen, statische Breite für Ihren text box.','Text Box Background'=>'Textfeld Hintergrund','Here you can define custom background for your text box.'=>'Hier können Sie festlegen, benutzerdefinierte hintergrund für Ihren text box.','Text Box Border Radius'=>'Text-Box-Border-Radius -','Here you can define the radius value for your text box border.'=>'Hier können Sie definieren den radius-Wert für das Textfeld Grenze.','Image Overlay'=>'Bild-Overlay','%1$s at %2$s'=>'%1$s in %2$s','Image path (%s) is not a directory.'=>'Image-Pfad (%s) ist nicht, ein Verzeichnis.','Image path (%s) is not readable.'=>'Image-Pfad (%s) ist nicht lesbar.','Image type (%s) is not supported.'=>'Image type (%s) ist nicht unterstützt.','Image file (%s) could not be generated.'=>'Image file (%s) konnte nicht generiert werden.','Image file (%s) does not exist.'=>'Image file (%s) existiert nicht.','Nightly'=>'Nächtlichen','Divi Squad Pro'=>'Divi Squad Pro','Copy Options'=>'Kopieren-Optionen','copy(s)'=>'kopieren(s)','to'=>'zu','this site'=>'diese Seite','Copy now!'=>'Kopieren Sie jetzt!','Please wait, copying in progress...'=>'Bitte warten Sie, kopieren in progress...','If you’re making a lot of copies, it can take a while %1$s(up to 5 minutes if you’re on a slow server).'=>'Wenn Sie sind machen eine Menge von Kopien, kann es eine Weile dauern, %1$s(bis zu 5 Minuten dauern, wenn Sie über einen lang